import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Signup from './components/Signup/SignUp'
import Login from './components/login/Login'
import FavShow from './components/FavShow/FavShow'
import MainPage from './components/LIst/MainPage';
import ActorList from './components/Actors/ActorsList';
import Userprofile from './components/Userprofiles/Userprofile'
import Editprofile from './components/Userprofiles/Editprofile'

const App = () => {
  return (
    <div className='App'>
    <Router>
      <Routes>
        <Route exact path="/" component={Signup} />
        <Route exact path="/main" component={MainPage} />
        <Route path="/Actors" component={ActorList} />
        <Route path="/Fav" component={FavShow} />
        <Route path="/Login" component={Login} />
        <Route path="/userDetails" component={Userprofile} />
        <Route path="/editUser" component={Editprofile} />
      </Routes>
    </Router>
    </div>
  );
};

export default App;
